PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "readings" (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  system_id INTEGER NOT NULL,
  inverter_time INTEGER NOT NULL,
  received_time INTEGER NOT NULL,
  delay_seconds INTEGER,
  solar_w INTEGER NOT NULL,
  solar_inverter_w INTEGER NOT NULL,
  shunt_w INTEGER NOT NULL,
  load_w INTEGER NOT NULL,
  battery_w INTEGER NOT NULL,
  grid_w INTEGER NOT NULL,
  battery_soc REAL NOT NULL,
  fault_code INTEGER NOT NULL,
  fault_timestamp INTEGER NOT NULL,
  generator_status INTEGER NOT NULL,
  solar_kwh_total REAL,
  load_kwh_total REAL,
  battery_in_kwh_total REAL,
  battery_out_kwh_total REAL,
  grid_in_kwh_total REAL,
  grid_out_kwh_total REAL,
  created_at INTEGER NOT NULL DEFAULT (unixepoch()),
  FOREIGN KEY (system_id) REFERENCES systems(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "polling_status" (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  system_id INTEGER NOT NULL,
  last_poll_time INTEGER,
  last_success_time INTEGER,
  last_error_time INTEGER,
  last_error TEXT,
  last_response TEXT,
  consecutive_errors INTEGER NOT NULL DEFAULT 0,
  is_active INTEGER NOT NULL DEFAULT 1,
  total_polls INTEGER NOT NULL DEFAULT 0,
  successful_polls INTEGER NOT NULL DEFAULT 0,
  updated_at INTEGER NOT NULL DEFAULT (unixepoch()),
  FOREIGN KEY (system_id) REFERENCES systems(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "systems" (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id TEXT NOT NULL,
  system_number TEXT NOT NULL,
  display_name TEXT,
  model TEXT,
  serial TEXT,
  ratings TEXT,
  solar_size TEXT,
  battery_size TEXT,
  created_at INTEGER NOT NULL DEFAULT (unixepoch()),
  updated_at INTEGER NOT NULL DEFAULT (unixepoch())
);
CREATE TABLE IF NOT EXISTS readings_duplicates_backup(
  id INT,
  system_id INT,
  inverter_time INT,
  received_time INT,
  delay_seconds INT,
  solar_w INT,
  solar_inverter_w INT,
  shunt_w INT,
  load_w INT,
  battery_w INT,
  grid_w INT,
  battery_soc REAL,
  fault_code INT,
  fault_timestamp INT,
  generator_status INT,
  solar_kwh_total REAL,
  load_kwh_total REAL,
  battery_in_kwh_total REAL,
  battery_out_kwh_total REAL,
  grid_in_kwh_total REAL,
  grid_out_kwh_total REAL,
  created_at INT
);
CREATE TABLE IF NOT EXISTS readings_agg_5m (
  id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
  system_id INTEGER NOT NULL,
  interval_end INTEGER NOT NULL, -- Unix timestamp of interval end
  
  -- Power values (Watts) - stored as INTEGER like source
  solar_w_avg INTEGER,
  solar_w_min INTEGER,
  solar_w_max INTEGER,
  load_w_avg INTEGER,
  load_w_min INTEGER,
  load_w_max INTEGER,
  battery_w_avg INTEGER,
  battery_w_min INTEGER,
  battery_w_max INTEGER,
  grid_w_avg INTEGER,
  grid_w_min INTEGER,
  grid_w_max INTEGER,
  
  -- Battery SOC (percentage) - REAL with 1 decimal precision
  battery_soc_last REAL,
  
  -- Energy totals (kWh) - REAL with 3 decimal precision
  solar_kwh_total_last REAL,
  load_kwh_total_last REAL,
  battery_in_kwh_total_last REAL,
  battery_out_kwh_total_last REAL,
  grid_in_kwh_total_last REAL,
  grid_out_kwh_total_last REAL,
  
  -- Metadata
  sample_count INTEGER NOT NULL,
  created_at INTEGER NOT NULL DEFAULT (strftime('%s', 'now'))
);
DELETE FROM sqlite_sequence;
CREATE INDEX system_inverter_time_idx ON readings (system_id, inverter_time);
CREATE INDEX inverter_time_idx ON readings (inverter_time);
CREATE INDEX received_time_idx ON readings (received_time);
CREATE INDEX polling_system_idx ON polling_status (system_id);
CREATE INDEX user_system_idx ON systems (user_id, system_number);
CREATE UNIQUE INDEX polling_status_system_id_unique ON polling_status(system_id);
CREATE UNIQUE INDEX readings_system_inverter_time_unique 
  ON readings (system_id, inverter_time);
CREATE UNIQUE INDEX readings_agg_5m_system_interval_idx 
  ON readings_agg_5m (system_id, interval_end);
CREATE INDEX readings_agg_5m_system_id_idx 
  ON readings_agg_5m (system_id);
CREATE INDEX readings_agg_5m_interval_end_idx 
  ON readings_agg_5m (interval_end);
COMMIT;
